sprites.onOverlap(SpriteKind.Player, SpriteKind.riser, function (sprite2, otherSprite) {
    if (level == 1) {
        tiles.placeOnTile(V, tiles.getTileLocation(1, 27))
        info.changeLifeBy(-1)
    }
    if (level == 2) {
        tiles.placeOnTile(V, tiles.getTileLocation(15, 16))
        info.changeLifeBy(-1)
    }
})
scene.onHitWall(SpriteKind.riser, function (sprite2) {
    if (hammerspike.kind() == SpriteKind.riser) {
        hammerspike.setKind(SpriteKind.faller)
        hammerspike.setVelocity(0, -20)
    }
})
